import WorkCard from './WorkCard';

const Work = () => {
    return (
        <div>
            <div className="flex grid grid-cols-3 w-full">
            <WorkCard
                height = '200px'
            />
            <WorkCard
                height = '400px'
            />
            <WorkCard
                height = '300px'
            />
            <WorkCard
                height = '200px'
            />
            <WorkCard
                height = '600px'
            />
        </div>
            <div className="columns-1 gap-4">
                {[24, 32, 36, 32, 32, 32, 16, 16, 64].map((height, index) => (
                    <div
                    key={index}
                    className={`mb-4 h-${height} break-inside-avoid rounded-xl border-2 border-slate-400/10 bg-neutral-100 p-4 dark:bg-neutral-900`}
                    />
                ))}
            </div>
        </div>

    );
}

export default Work;
